import "./W3.css";
import "./css/Text.css";

function GamePad(props) {
  const data = props.gamePadData;
  console.log(data);
  const classes = "w3-padding-64 " + props.className;
  return (
    <div className={classes}>
      <h1 data-shadow={data.header}>{data.header}</h1>
      <iframe
        frameborder="0"
        src="https://itch.io/embed-upload/3457217?color=333333"
        allowfullscreen=""
        width="640"
        height="380"
      >
        <a href="https://steven-lpz.itch.io/killbot">Play KILLBOT on itch.io</a>
      </iframe>
      {props.children}
    </div>
  );
}
export default GamePad;
